import sys
from bisect import bisect_left

class Solution(object):
    def sumOfFlooredPairs(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        nums.sort()
        MOD, n, d = 1000000007, len(nums), {}
        ans = 0

        for i, val in enumerate(nums):
            if val not in d:
                curr_ans = 0
                j = i
                while j < n:
                    coef = nums[j] // val
                    k = bisect_left(nums, val*(coef+1))
                    curr_ans += (k - j) * coef
                    j = k
                d[val] = curr_ans
            ans += d[val]
            ans %= MOD

        return ans


